import React from "react";
import { Link } from "react-router-dom";

const Boxes = () => {
  return (
    <div className="box">
      <Link className="" to={`/frontend/`} />
      <div className="box-1">
        <h3 className="box-title">frontend developer </h3>
      </div>
      <div className="box-2">
        <h3 className="box-title">entrepreneurship </h3>
      </div>
      <div className="box-3">
        <h3 className="box-title">soft skills </h3>
      </div>
      <div className="box-4">
        <h3 className="box-title">know me better </h3>
      </div>
    </div>
  );
};

export default Boxes;
